export const Button = (props) => (
  <button 
  onClick={props.onClick}
  disabled={props.disabled || false}
  >
     { props.children }
     <style jsx>{`
        button {
          padding: 2px 5px;
          margin: 5px;
          background: ${props.background || 'white'};
          color: green;
          display: inline-block;
          font-size: 1em;
        }
     `}</style>
  </button>
)
